--
SELECT COUNT(esxhost) esxhosts,
       COUNT(esxhost) * 512 * 1014 esxhost_tot_mem,
       COUNT(esxhost) * 40 esxhost_tot_cpu
  FROM  (SELECT DISTINCT esxhost
                     FROM vmware_servers_20042015
                    WHERE UPPER (vmcluster) LIKE '%ORACLE%');
                    
                    
SELECT COUNT(*) vhosts,
       SUM(vmem) vhost_tot_mem,
       SUM(vcpu) vhost_tot_cpu
  FROM vmware_servers_20042015
 WHERE esxhost IN (SELECT DISTINCT esxhost
                     FROM vmware_servers_20042015
                    WHERE UPPER (vmcluster) LIKE '%ORACLE%');
 
--
-- List Total host, Memory and CPU counts for ESX hosts and VHOSTS 
--
SELECT 'ESXHOST LEVEL' , 
       COUNT(esxhost) hosts,
       COUNT(esxhost) * 512 * 1014 tot_mem,
       COUNT(esxhost) * 40 tot_cpu
  FROM  (SELECT DISTINCT esxhost
                     FROM vmware_servers_20042015
                    WHERE UPPER (vmcluster) LIKE '%ORACLE%')
UNION                    
SELECT 'VHOST LEVEL' , 
       COUNT(*) hosts,
       SUM(vmem) tot_mem,
       SUM(vcpu) tot_cpu
  FROM vmware_servers_20042015
 WHERE esxhost IN (SELECT DISTINCT esxhost
                     FROM vmware_servers_20042015
                    WHERE UPPER (vmcluster) LIKE '%ORACLE%');
                     
 
--
--
-- 
SELECT vmcluster ,
sum(vcpu) ALLOCATED_CPU,
sum(vmem) ALLOCATED_MEM
FROM vmware_servers_20042015
WHERE upper(vmcluster) LIKE '%ORACLE%'
GROUP BY vmcluster; 
--
-- Number of esxhosts per ESX Cluster 
--
SELECT vmcluster, count(esxhost)
FROM (SELECT DISTINCT vmcluster, esxhost FROM vmware_servers_20042015 WHERE UPPER (vmcluster) LIKE '%ORACLE%')
GROUP BY vmcluster
ORDER BY vmcluster;
 

--
-- vCPUs allocated by esxhost
--
SELECT esxhost, sum(vcpu)
FROM vmware_servers_20042015
WHERE upper(vmcluster) LIKE '%ORACLE%'
GROUP BY esxhost
ORDER BY sum(vcpu) DESC;
                    
SELECT vhost, esxhost,
vmcluster, dcd,
       vmem,
       vcpu
  FROM vmware_servers_20042015
 WHERE esxhost IN (SELECT DISTINCT esxhost
                     FROM vmware_servers_20042015
                    WHERE UPPER (vmcluster) LIKE '%ORACLE%')                    